import React from 'react';
import Header from '../Header';
import Intro from '../Intro';
import Background from '../Background';
import DSN from '../DSN';
import Solution from '../Solution';
import Footer from '../Footer';

function App() {
  return (
    <div className="App">
      <Header/>
      <Intro/>
      <Background/>
      <DSN/>
      <Solution/>
      <Footer/>
    </div>
  );
}

export default App;
